import React, { Component } from 'react';
import Header from "../Common/Header";
import image from '../assests/img/Team.png'

class MainTeam extends Component
{
    render()
    {
        return 
        <Header 
        title="Team!" showButton={false} image={image} />;

    }
}

export default MainTeam;
